import React from "react"

function CategorySelection(props) {
    let cardList = props.list.map((cat, index) => {
        return (<p key={index} 
                    onClick={props.handleClick}>
                    {cat.id}
                </p>)
    })

    return (
        <>
            {cardList}
        </>
    )
}

export default CategorySelection;
